import React, {Fragment, Component} from 'react';
import grapejs from 'grapesjs';
import 'grapesjs/dist/css/grapejs.min.css';
import 'grapejs/dist/grapes.min.js';
import 'grapesjs-preset-webpage/dist/grapejs-preset-webpage.min.css';
import 'grapesjs-preset-webpage/dist/grapejs-preset-webpage.min.js';

import ReactDOM from 'react-dom';

class App extends Component {
  componentDidMount() {
    grapejs.init({
      container: '#gjs',
      plugins: ['gjs-preset-webpage'],
    })
  }

  render(){
    return (
      <Fragment>
        <div id="gjs"></div>
      </Fragment>
    )
  }
}

export default App;
